import React, { Component } from "react";
import axios from "axios";

class FamilyPage extends Component {
  state = {
    family: "",
  };

  componentDidMount() {
    axios.get("/api/getfamily");
  }

  render() {
    return <div>Family Page!</div>;
  }
}

export default FamilyPage;
